// =====================
//  Фильтр Савицкого–Голея
// =====================
const savitzkyGolay = (data, window = 21, poly = 3) => {
  if (window % 2 === 0) window += 1;
  const half = Math.floor(window / 2);
  const result = new Array(data.length).fill(0);
  for (let i = 0; i < data.length; i++) {
    let acc = 0;
    for (let k = -half; k <= half; k++) {
      const idx = Math.min(Math.max(i + k, 0), data.length - 1);
      const weight = 1 - 3 * k * k / (half * half + half);
      acc += data[idx] * weight;
    }
    result[i] = acc / window;
  }
  return result;
};

// =====================
//  Удаление baseline
// =====================
const removeBaseline = (arr, N = 2000) => {
  const count = Math.min(arr.length, N);
  const avg = arr.slice(0, count).reduce((s, v) => s + v, 0) / count;
  return arr.map(v => v - avg);
};

// =====================
//  Основная функция CSV
// =====================
export const processCSVData = file => {
  return new Promise((resolve, reject) => {
    const reader = new FileReader();
    reader.onload = e => {
      try {
        const csvText = e.target.result;
        const results = parseCSV(csvText);
        resolve(results);
      } catch (error) {
        reject(error);
      }
    };
    reader.onerror = () => reject(new Error("Ошибка чтения файла"));
    reader.readAsText(file);
  });
};

// =====================
//  Парсинг CSV
// =====================
const parseCSV = csvText => {
  const lines = csvText.split("\n");
  const t = [];
  const tenz = [];
  const interf = [];
  let dataStarted = false;
  let lineCount = 0;
  for (let i = 0; i < lines.length; i++) {
    const line = lines[i].trim();
    if (!line) continue;
    if (line.startsWith("TIME,CH1,")) {
      dataStarted = true;
      continue;
    }
    if (dataStarted) {
      lineCount++;
      if (lineCount < 6650) continue;
      if (lineCount > 27000) break;
      const fields = line.split(",");
      if (fields.length >= 5) {
        const timeVal = parseFloat(fields[0]);
        const ch1Val = parseFloat(fields[1]);
        const ch3Val = parseFloat(fields[3]);
        if (!isNaN(timeVal) && !isNaN(ch1Val) && !isNaN(ch3Val)) {
          t.push(timeVal);
          tenz.push(ch1Val * 0.00132 * 1.25);
          interf.push(ch3Val + 0.04);
        }
      }
    }
  }

  // ------------------------------------
  // Фильтрация Savitzky–Golay (как в Origin)
  // ------------------------------------
  const tenzSmoothed = savitzkyGolay(tenz, 31, 3);
  const interfSmoothed = savitzkyGolay(interf, 31, 3);

  // baseline correction
  const tenzBaseline = removeBaseline(tenzSmoothed);
  const interfBaseline = removeBaseline(interfSmoothed);

  // производная (цифровое дифференцирование)
  const dudt_interf = derivative(t, interfBaseline);
  return {
    t,
    tenzRaw: tenz,
    interfRaw: interf,
    tenz: tenzBaseline,
    interf: interfBaseline,
    dudt_interf
  };
};

// =====================
//  Производная через разностный оператор
// =====================
const derivative = (t, y) => {
  const d = new Array(t.length).fill(0);
  for (let i = 1; i < t.length - 1; i++) {
    const dt = t[i + 1] - t[i - 1];
    d[i] = dt !== 0 ? (y[i + 1] - y[i - 1]) / dt : 0;
  }
  d[0] = d[1];
  d[d.length - 1] = d[d.length - 2];

  // сглаживание производной
  return savitzkyGolay(d, 21, 3);
};

// =====================
//  Подготовка данных для графиков
// =====================
export const generateChartData = results => {
  const {
    t,
    tenz,
    interf,
    dudt_interf
  } = results;
  const step = Math.max(1, Math.floor(t.length / 2000));
  const limitedT = [];
  const limitedTenz = [];
  const limitedInterf = [];
  const limitedDudt = [];
  for (let i = 0; i < t.length; i += step) {
    limitedT.push(t[i]);
    limitedTenz.push(tenz[i]);
    limitedInterf.push(interf[i]);
    limitedDudt.push(dudt_interf[i]);
  }
  return {
    original: [{
      label: "Тензосигнал (сглаженный)",
      data: limitedT.map((time, idx) => ({
        x: time,
        y: limitedTenz[idx]
      })),
      borderColor: "rgb(255, 99, 132)",
      tension: 0.15
    }, {
      label: "Интерферометр (сглаженный)",
      data: limitedT.map((time, idx) => ({
        x: time,
        y: limitedInterf[idx]
      })),
      borderColor: "rgb(54, 162, 235)",
      tension: 0.15
    }],
    processed: [{
      label: "Производная интерферометра (правильная)",
      data: limitedT.map((time, idx) => ({
        x: time,
        y: limitedDudt[idx]
      })),
      borderColor: "rgb(75, 192, 192)",
      tension: 0.2
    }],
    rawData: results
  };
};

